import { Grid, Box,Paper, Typography, Stack, TextField } from '@mui/material'
import { styled } from "@mui/material/styles";

import React from 'react'



// Custom TextField

const CTextField = styled(TextField)({
    '& .MuiInputBase-input': {
  
      position: 'relative',
      fontSize: 20,
      padding: '12px',
  
    },
    "& label.Mui-focused": {
      color: "#9B3C21"
    },
  
    "& .MuiOutlinedInput-root": {
      "& fieldset": {
        border: "2px solid #000000",
      },
      "&.Mui-focused fieldset": {
  
        border: "2px solid #9B3C21"
      }
    }
  });

const Edit_profile = () => {
  return (
    <div>
        <Grid
        container
        direction="column "
        justifyContent="center"
        alignItems="center">

        <Box padding={2} paddingTop={20}>

            <Grid 
            component={Paper} 
            variant='outlined' 
            padding={3}
            style={{
                backgroundColor:'white',
                border:'2px solid black'
            }}>
                <Stack
                direction="column"
                justifyContent="center"
                alignItems="center"
                spacing={2}>
                    <Box style={{
                        width:100,
                        height:100,
                        backgroundColor:'red',
                        borderRadius:600
                    }}/>

                    {/* Label Name */}
                    <Typography  variant='h4'>Francis Maneclang</Typography>
                    <Typography  variant='h6'>CEO</Typography>
                    {/* Email edit */}
                    <Typography  variant='h4'>Hello Friend Hello Friend</Typography>
                    <Typography  variant='h4'>Hello Friend Hello Friend</Typography>


                </Stack>
              




              


            




            </Grid>
       
                

            


         
    
        </Box>
         
        </Grid>
    </div>
  )
}

export default Edit_profile
